INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2025/01/31 12:00:00", 1, -363.0, "カリン", 1, "2030/01/01 14:59:59", 1000005, 2.12, 5, 64, 190805, 0.0);
