INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2025/01/31 12:00:00", 1, -363.0, "カリン", 1, "2030/01/01 14:59:59", 1000007, 2.33, 7, 64, 190805, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2025/01/31 12:00:00", 7, -285.0, "ラビリスタ", 10201, "2030/01/01 14:59:59", 1020101, 5.18, 101, 61, 133701, -6.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2025/01/31 12:00:00", 2, -285.0, "クリスティーナ", 10201, "2030/01/01 14:59:59", 1020102, 8.77, 201, 61, 133901, -2.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (6, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2025/01/31 12:00:00", 1, -285.0, "ネネカ", 10201, "2030/01/01 14:59:59", 1020103, 15.5, 301, 61, 133801, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2025/02/28 12:00:00", 5, -285.0, "ランファ", 10202, "2030/01/01 14:59:59", 1020201, 9.061, 101, 61, 134301, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2025/02/28 12:00:00", 2, -285.0, "チカ", 10202, "2030/01/01 14:59:59", 1020202, 7.699, 201, 61, 134401, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2025/03/31 12:00:00", 2, -285.0, "アオイ", 10203, "2030/01/01 14:59:59", 1020301, 8.595, 101, 61, 134601, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2025/03/31 12:00:00", 2, -285.0, "クローチェ", 10203, "2030/01/01 14:59:59", 1020302, 7.758, 201, 61, 134501, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2025/04/30 12:00:00", 6, -285.0, "ルイズマリー", 10204, "2030/01/01 14:59:59", 1020401, 7.0, 101, 61, 132302, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2025/04/30 12:00:00", 2, -285.0, "イロハ", 10204, "2030/01/01 14:59:59", 1020402, 7.904, 201, 61, 132402, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (4, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2025/04/30 12:00:00", 2, -285.0, "ソノ", 10204, "2030/01/01 14:59:59", 1020403, 8.487, 301, 61, 132502, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2025/05/31 12:00:00", 2, -285.0, "カノン", 10205, "2030/01/01 14:59:59", 1020502, 8.763, 101, 61, 134901, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2025/05/31 12:00:00", 3, -285.0, "ツムギ", 10205, "2030/01/01 14:59:59", 1020503, 6.417, 201, 61, 134801, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "2025/06/30 12:00:00", 7, -285.0, "エリス", 10206, "2030/01/01 14:59:59", 1020601, 10.335, 101, 61, 135001, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "2025/06/30 12:00:00", 4, -285.0, "シェフィ", 10206, "2030/01/01 14:59:59", 1020602, 6.281, 201, 61, 135101, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "2025/06/30 12:00:00", 2, -285.0, "プレシア", 10206, "2030/01/01 14:59:59", 1020603, 12.244, 301, 61, 135201, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "2025/07/31 12:00:00", 8, -285.0, "クリア", 10207, "2030/01/01 14:59:59", 1020701, 6.339, 101, 61, 135301, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (7, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "2025/07/31 12:00:00", 9, -285.0, "アネモネ", 10207, "2030/01/01 14:59:59", 1020702, 8.184, 201, 61, 135401, 0.0);
